import React from 'react';
import './css/Favorites.css'

import Header from './components/Header/Header'


class Favorites extends React.Component {
  state = {
  }

  render () {
    return (
      <div className="Favorites">
        <Header
          exitApp={this.exitApp}
        />
      </div>
    )
  }
}

export default Favorites;
